window.bookSummaryJSON = "<p><b>A newborn dragon is forced to come to terms with his reality: his body is not made of flesh and blood—but of ice cream.</b></p> <p>No fate is worse than being a failure before birth. His future holds endless troubles and dangers—wild animals, greedy humans, and ancient secrets. What can a small mutated hatchling do?</p> <p>He must grow stronger.</p> <p>With few options besides magic, he turns to the Nexus, a being of untold power that rewards its users with experience and stat points at great cost. But that does not mean his enemies are without strength. Levels and stats are available to all in this dragon-eat-dragon world.</p>"; 
